const userList = [
    {id: 1, name: "INSHA KHOWAJA", country: "PAKISTAN"},
    {id: 2, name: "OSAMA AHMED", country: "PAKISTAN"},
    {id: 3, name: "ANESH", country: "NEPAL"},
    {id: 4, name: "LIN", country: "CHINA"},
    {id: 5, name: "ALESSIO", country: "AUSTRALIA"}
    ];

    const Block = ({username}) => (
                <div>
                {username.map(user =>


                            <div>
                                <div key={user.id}>
                                    <h5>{user.name}</h5>
                                    <h6>{user.country}</h6>
                                </div>
                            </div>

                )}
                </div>
            )

    export default Block
